import React from "react";
import StockItem from "./StockItem";
import PropTypes from 'prop-types';

const itemsInStock = [
  {
    name: 'Vinyl LP',
    price: '$30',
    leftInStock: '20',
    id: '1'
  },
  {
    name: 'T-shirt',
    price: '$15',
    leftInStock: '25',
    id: '2'
  },
  {
    name: 'Hoodie',
    price: '$45',
    leftInStock: '10',
    id: '3'
  }
];

function MasterStock(props){
  return (
    <React.Fragment>
      <hr/>
      {props.itemsInStock.map((item, index) =>
        <StockItem name={item.name}
          price={item.price}
          leftInStock={item.leftInStock}
          id={item.id}
          key={index}/>
      )}
    </React.Fragment>
  );
}

MasterStock.propTypes = { //add this with new prop passed down
  masterStock: PropTypes.array
};

export default MasterStock;
